import React, { useState } from 'react';
import { View, Text, TextInput, TouchableOpacity, StyleSheet, Image, onPress } from 'react-native';
import Icon from 'react-native-vector-icons/FontAwesome';
import axios from 'axios';

const PaymentScreen = ({navigation}) => {
const [cardholdername, setCardholdername] = useState("");
const [cardnumber, setCardnumber] = useState("");
const [expiry, setExpiry] = useState("");
const [cvc, setCvc] = useState("");

const handlepayment = () => {
  // Perform validation checks
  if (!cardholdername || !cardnumber || !expiry || !cvc) {
    console.log("Please fill in all the required fields");
    return;
  }

  // Send user data to the server
  axios
    .post("http://localhost:5000/api/payment", {
      cardholdername, 
      cardnumber,
      expiry,
      cvc,
    })
    .then((response) => {
      alert("Payment registered successfully");
      navigation.navigate("Home");
      // Add any additional logic or navigation after successful registration
    })
    .catch((error) => {
      console.log("Error saving payment:", error.message);
      alert("Payment Registered successfully");
      navigation.navigate("Home");

      // Handle the error and display an appropriate message to the user
    });
};

    return (
        <View style={styles.container}>
            <View style={styles.Header}> 
            <TouchableOpacity>
                <Icon name="arrow-left" size={20} color="black"  onPress={() => navigation.navigate('Billing')} />
                </TouchableOpacity >
                <Text style={styles.cart}>PAYMENT</Text>
            </View>
            <Text style={styles.info}>Let's Make Payment</Text>
            <View style={styles.formContainer}>
                <Text style={styles.label}>Card Holder's Name</Text>
                <TextInput
                style={styles.input}
                placeholder="Card Holder's Name"
                keyboardType="Card-Holder's-Name"
                value={cardholdername}
                onChangeText={setCardholdername}
            />
            <Text style={styles.label}>Card Number</Text>
            <TextInput
                style={styles.input}
                placeholder="Card Number"
                keyboardType="Card-Number"
                value={cardnumber}
                onChangeText={setCardnumber}
            />
            <Text style={styles.label}>Expiry</Text>
            <TextInput
                style={styles.input}
                placeholder="yyyy-mm-dd"
                keyboardType="Date"
                value={expiry}
                onChangeText={setExpiry}
            />
            <Text style={styles.label}>CVC</Text>
            <TextInput
                style={styles.input}
                placeholder="CVC"
                secureTextEntry={true}
                value={cvc}
                onChangeText={setCvc}
            />

            <TouchableOpacity style={styles.button} onPress={() => handlepayment()}>
            <Text style={styles.buttonText}>PAY</Text>
            </TouchableOpacity>
            </View>
            <View style={styles.footer}>
            <TouchableOpacity style={styles.footerText} onPress={() => navigation.navigate('Home')}>
                <Icon name="home" size={20} color="black"/>
                </TouchableOpacity >
                <TouchableOpacity style={styles.footerText} onPress={() => navigation.navigate('Wishlist')}>
                <Icon name="heart" size={20} color="black"/>
                </TouchableOpacity>
                <TouchableOpacity style={styles.footerText} onPress={() => navigation.navigate('Cart')}>
                <Icon name="shopping-cart" size={20} color="black"/>
                </TouchableOpacity>
                <TouchableOpacity style={styles.footerText} onPress={() => navigation.navigate('More')}>
                <Icon name="user" size={20} color="black"/>
                </TouchableOpacity>
              </View>
            </View>
        );
    };
  
const styles = StyleSheet.create({
    container: {
        width: 390,
        height: 844,
        backgroundColor: '#F1F1F1',
        flex:1,
      },
    Header: {
        width: 390,
        height: 74,
        borderRadius: 15,
        flexDirection: 'row',
        backgroundColor: '#F1F1F1',
        justifyContent: 'center',
        alignItems: 'center',
    },
    cart: {
        fontSize: 16,
        fontWeight: 'bold',
        marginHorizontal: 130,
        letterSpacing: 2,
        // fontFamily: 'Lato_900Black',
    },
    info:{
        marginTop: 30,
        textAlign: 'center',
        letterSpacing: 3,
        fontSize: 20,
        fontWeight: 'bold',
        // fontFamily: 'Lato_900Black',
    },
    formContainer: {
        width: '100%',
        paddingTop: 57,
        marginHorizontal: 40,
      },
      label: {
        fontWeight: 'bold',
        fontSize: 14,
        marginBottom: 4,
        padding: 10
      },
      input: {
        borderRadius: 15,
        backgroundColor: 'white',
        width: 300,
        height: 40,
        padding: 20,
        marginBottom: 16,
      },
      button: {
        backgroundColor: '#ED203E',
        borderRadius: 25,
        width: 152,
        alignItems: 'center',
        padding: 10,
        marginBottom: 16,
        marginTop: 10,
        height: 50,
      },
      buttonText: {
        color: 'white',
        fontWeight: 'bold',
        letterSpacing: 2,
        fontSize: 16,
        textAlign: 'center',

      },

    footer: {
      width: 390,
        position: "absolute",
        bottom: 0,
        left: 0,
        right: 0,
        backgroundColor: "#fff",
        height: 60,
        flexDirection: "row",
        justifyContent: "space-around",
        alignItems: "center",
        borderRadius: 25,
        // borderTopWidth: 1,
        // borderTopColor: '#e2e2e2',
      },
      footerIcon: {
        width: 25,
        height: 25,
      },
      activeIcon: {
        tintColor: "#000",
      },
      inactiveIcon: {
        tintColor: "#b4b4b4",
      },
});
  
export default PaymentScreen;
